css:
.git-control .diff {
  width: 100%;
  height: 100%;
  overflow-y: scroll;
  padding: 10px 10px 80px 10px;
  background: inherit;
}
.git-control .diff .line.subtle {
  color: #555555;
}
.git-control .diff .line.red {
  color: #cc0000;
}
.git-control .diff .line.green {
  color: #2bda77;
}
.git-control .diff .line.heading {
  color: #ffffff;
  cursor: pointer;
}
.git-control .diff .line + .line.heading {
  margin-top: 15px;
}
.git-control .diff .line pre {
  display: inline-block;
}
.git-control .diff .line pre.lineno {
  color: #555555;
}
